import Detect from "./components/Layout/Detect";
import Header from "./components/Layout/Header";
import Errors from "./components/Errors/errors";

function App() {
  return (
    <>
    <Header color={'#A459D1'} errors={<Errors/>}/>
    <Detect color={'#E9A178'}/>
    <Detect color={'#F7C04A'}/>
    <Detect color={'#609966'}/>
    </>
  );
}

export default App;
